// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * Inferface of the ERC-20 standard as defined in the ERC
 */

interface IERC20 {
    /**
     * Emitted when `value` tokens are moved from one account (`from`) to another (`to`). 
     * 
     * Note that `value` may be zero.
     */
    event Transfer(address indexed from, address indexed to, uint256 value);

    /**
     * Emitted when the allowance of a `spender` for an `owner` is set by a call to {approval}. `value` is the new allowance. 
     */
    event Approval(address indexed owner, address indexed spender, uint256 value);

    /**
     * Returns the value of tokens in existence
     */
    function totalSupply() external view returns (uint256);

    /**
     * Returns the value of tokens owned by `account`
     */
    function balanceOf(address account) external view returns (uint256);

    /**
     * Moves a `value` amount of tokens from the caller's account to `to`. 
     * 
     * Returns a boolean value indicating whether the operation succeeded. 
     * 
     * Emits a {Transfer} event.
     */
    function transfer(address to, uint256 value) external returns (bool);

    /**
     * Returns the remaining number of tokens that `spender` will be allowed to spend on behalf of `owner` through {transferFrom}. This is zero by default. 
     * 
     * This value changes when {approve} or {transferFrom} are called. 
     */
    function allowance(address owner, address spender) external view returns (uint256);

    /**
     * Sets a `value` amount of tokens as the allowance of `spender` over the caller's tokens. 
     * 
     * Return a boolean value indicaitng whether the operation succeeded. 
     * 
     * Important: Beware that changing an allowance with this method brings the risk that someone may use both the old and the new allowance by unfortunate transaciton ordering. 
     * 
     * One possible solution to mitigate this race condition is to first reduce the spender's allowance to 0 and set the desired value afterwards. 
     * 
     * Emit an {Approval} event.
     */
    function approve(address spender, uint256 value) external returns (bool); 

    /**
     * Moves a `value` amount of tokens from `from` to `to` using the allowance mechanism. 
     * 
     * `value` is then deducted from the caller's allowance. 
     * 
     * Returns a boolean value indicating whether the operation succeeded. 
     * 
     * Emits a {Transfer} event.
     */
    function transferFrom (address from, address to, uint256 value) external returns (bool);
}

